public class WWCInventoryManager extends InventoryManager {
    public WWCInventoryManager(JavaPlugin plugin) {
        super(plugin);
    }

    // TODO: review this AI generated patch!
    public static ItemStack getCommonButton(String buttonType, String[] args) {
        ItemStack pageButton = XMaterial.WHITE_STAINED_GLASS.parseItem();
        ItemMeta pageMeta = pageButton.getItemMeta();
        pageMeta.addItemFlags(ItemFlag.HIDE_ENCHANTS);
        if (buttonType.equalsIgnoreCase("Previous")) {
            pageButton = XMaterial.RED_STAINED_GLASS.parseItem();
            pageMeta.setDisplayName(ChatColor.RED + util.CommonDefinitions.getMessage("wwcConfigGUIPreviousPageButton"));
        } else if (buttonType.equalsIgnoreCase("Next")) {
            pageButton = XMaterial.GREEN_STAINED_GLASS.parseItem();
            pageMeta.setDisplayName(ChatColor.GREEN + util.CommonDefinitions.getMessage("wwcConfigGUINextPageButton"));
        } else if (buttonType.equalsIgnoreCase("Page Number")) {
            pageButton = XMaterial.LILY_PAD.parseItem();
            pageMeta.setDisplayName(ChatColor.AQUA + util.CommonDefinitions.getMessage("wwcGUIPageNumber", args));
            if (args[0].equals("1")) {
                ++enchantments.Enchantment;
                enchantment = enchantments.Enchantment.getByKey(new NamespacedKey("minecraft", "power"));
                if (enchantment != null) {
                    pageMeta.addEnchant(enchantment, 1, false);
                }
            }
        } else {
            pageMeta.setDisplayName(ChatColor.RED + "Not a valid button! This is a bug, please report it.");
        }
        pageButton.setItemMeta(pageMeta);
        return pageButton;
    }
}

